typedef long long ll;
typedef long double ld;
typedef unsigned long long ull;

ll lcm(ll a, ll b) {
    return a / __gcd(a, b) * b;
}

void solve() {
    ll a, b;
    cin >> a >> b;
    ll g = __gcd(a, b);
    ll l = lcm(a, b);
    if (a == g && b == l) {
        cout << a << " " << b << endl;
    }
    else {
        cout << -1 << endl;
    }
}

